import './section3.css';
import Img1 from './phone1.png';
import Img2 from './phone2.png';
const section3 = () => {
    return ( 
        <div className="section3">
            <div className="outterdiv">
                <h1>
                    Restaurants in your pocket
                </h1>
            </div>
            <img src={Img1} alt="" />
            <img src={Img2} alt="" />
        </div>
     );
}

export default section3;
